import React, { useState } from 'react';
import { StatusBar } from 'expo-status-bar';
import { KeyboardAvoidingView, StyleSheet, View } from 'react-native';
import { Button, Input, Text } from 'react-native-elements'
const RegisterScreen = ({ navigation }) => {
    const [name, setName] = useState('');
    const [email, setEmail] = useState('');
    const [pass, setPass] = useState('');
    const [rass, setRass] = useState('');
    const register = () => { };
    return <KeyboardAvoidingView enabled style={styles.constainer}>
        <StatusBar style='light' />
        <Text h3 style={{ marginBottom: 50 }}>Create new account</Text>
        <View style={styles.inpurContainer}>
            <Input placeholder='Full name' autoFocus type='text' value={name} onChangeText={(text) => setName(text)} />
            <Input placeholder='Email' autoFocus type='email' value={email} onChangeText={(text) => setEmail(text)} />
            <Input placeholder='Password' secureTextEntry type='password' value={pass} onChangeText={(text) => setPass(text)} />
            <Input placeholder='Repeat password' secureTextEntry type='password' value={rass} onChangeText={(text) => setRass(text)} />
        </View>
        <Button onPress={register} containerStyle={styles.button} title='Register' type='outline'></Button>
    </KeyboardAvoidingView>
}

export default RegisterScreen

